import React from "react";

const Footer = () => {
  return (
    <>
      <footer>
        <p className='text-center'>
          Food Delivery Website - 2023-2024, All Rights Reserved
          @royal-programmer
        </p>
      </footer>
    </>
  );
};

export default Footer;
